const axios = require("axios");

const App = () => {
  const find = async() => {
    const options = {
  method: 'POST',
  url: 'https://symptom-checker4.p.rapidapi.com/analyze',
  params: {
    symptoms: 'I have dots on my upperbody it\'s red but doesn\'t heart'
  },
  headers: {
    'content-type': 'application/json',
    'X-RapidAPI-Key': '3bc4205b95msh053da429b4479cdp13dcd3jsn57e065230884',
    'X-RapidAPI-Host': 'symptom-checker4.p.rapidapi.com'
  },
  data: {
    symptoms: 'I dont have power to do anything and I'
  }
};

try {
	const response = await axios.request(options);
	console.log(response.data);
} catch (error) {
	console.error(error);
}
  }
  find()
  return (
    <>
      <h1>Hello</h1>
    </>
  )
}

export default App;
